INSERT INTO `second_menu` VALUES ('1','',NULL,NULL,NULL,NULL,NULL,NULL,'1','/SpringWind/static/img/20180925150756588954.jpg','<p style=\"white-space: normal;\"><span style=\"font-size: 24px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">| 客户优先&nbsp; &nbsp; 只为目标想办法，不为省事找理由</span></p><p style=\"white-space: normal;\"><span style=\"font-size: 24px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;竭尽所能实现客户要求，只是不想对客户说 “对不起，做不到”</span></p><p style=\"white-space: normal;\"><span style=\"font-size: 24px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><br/></span></p><p style=\"white-space: normal;\"><span style=\"font-size: 24px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">| 专业&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 专业的文案、策划、视觉设计、影视拍摄、后期制作团队</span></p><p style=\"white-space: normal;\"><span style=\"font-size: 24px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;实战经验丰富，匠心打造每个项目</span></p><p style=\"white-space: normal;\"><span style=\"font-size: 24px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><br/></span></p><p style=\"white-space: normal;\"><span style=\"font-size: 24px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">| 全面&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 不必再东奔西走</span></p><p style=\"white-space: normal;\"><span style=\"font-size: 24px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;峰岚五大业务一站式达成企业文化和品牌建设目标</span></p><p><span style=\"font-size: 24px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><br/></span></p><p><br/></p><p><br/></p>',NULL,'/SpringWind/static/img/20180925150805295449.jpg'),('2',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2','/SpringWind/static/img/20180925151744599138.jpg','<p><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">大连峰岚文化传媒有限公司是一家为企业文化和品牌建设提供整体解决方案的企业服务一站式供应商。为企事业单位、团体和个人，提供专业的活动策划执行、学术&amp;商务会议承办、影视拍摄、视觉艺术传达以及新媒体互动营销服务。致力于让我们所服务的客户品牌，脱颖而出、占领认知、构架竞争壁垒。</span></p>',NULL,'/SpringWind/static/img/20180925151759448812.jpg'),('3',NULL,NULL,NULL,NULL,NULL,NULL,'/SpringWind/static/img/20180925152935626613.png,/SpringWind/static/img/20180925152937014617.png','3',NULL,'<p>选择峰岚文化，就是选择安心和卓有成效！</p><p><br/></p><p>客户优先</p><p>只为目标想办法，不为省事找理由竭尽所能实现客户要求，只是不想对客户说 “对不起，做不到”</p><p><br/></p><p>专&nbsp; &nbsp; 业</p><p>专业的文案、策划、视觉设计、影视拍摄、后期制作团队实战经验丰富，匠心打造每个项目</p><p><br/></p><p>全&nbsp; &nbsp; 面</p><p>不必再东奔西走峰岚五大业务一站式达成企业文化和品牌建设目标</p><p><br/></p>',NULL,NULL),('4',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'4','/SpringWind/static/img/20180921154628250043.jpg',NULL,NULL,NULL),('5',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'5','/SpringWind/static/img/20180925152244777876.jpg','<p><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">大连峰岚文化传媒有限公司</span><img src=\"http://demo.fenglanwenhua.com:8080/SpringWind/ueditor/jsp/upload/image/20180925/1537860145797066807.png\" style=\"float:right;\" title=\"1537860145797066807.png\" alt=\"erwei.png\"/><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"></span></p><p><br/></p><p><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">A.地址：大连市 高新园区 黄浦路720号 创意孵化园</span></p><p><br/></p><p><span style=\"font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">公众微信号&nbsp;→</span></p><p><br/></p><p><br/></p>',NULL,'/SpringWind/static/img/20180925152254766063.jpg');
